import React from 'react';
import {Img} from "../Public/Image";

class TopMenu extends React.Component {
    constructor(props) {
        super(props);

    }

    render() {
        return (
            <div className="top_menu">
                <div className="header_toggle">
                    <Img src="/indycare/src/resources/List/icon-menu.svg" alt="side_bar_toggle_menu"/>
                </div>

                <div className="item_wrap">
                    <div className="header_item">
                        <ul>
                            <li className="header_search">
                                <label for="search">
                                    <Img src="/indycare/src/resources/List/icon_search.svg" alt="Search_icon"/>
                                    <input type="text" placeholder="search for..." name="search"/>
                                    <input type="submit" className="blind"/>
                                </label>
                            </li>
                            <li>
                                <a href="/">
                                    <button>문의하기</button>
                                </a>
                            </li>
                            <li>
                                <Img src="/indycare/src/resources/List/icon_noti.svg" alt="Noti_icon"/>
                            </li>
                            <li>
                                <Img src="/indycare/src/resources/List/icon_log_out.svg" alt="Logout_icon"/>
                                <span>Log out</span>
                            </li>
                        </ul>
                    </div>
                </div>
            </div>
        );
    }
}

export default TopMenu;
